import React from "react";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import TodoApp from "./TodoApp/TodoApp";
import HackerNewStories from "./HackerNewStoriesApp/HackerNewStories";
import Home from "./Home/Home";
import styled from "styled-components";
import "./fontawesome"

const StyledNavbar = styled.nav`
  background: inherit;
  border: 2px solid #121212;
`;

export const App = () => {
  return (
    <Router>
      <StyledNavbar className="navbar bg-dark text-primary d-flex justify-content-end ">
        <ul className="nav">
          <li className="nav-item">
            <Link to="/">
              <span className="nav-link">Home</span>
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/todo-app">
              <span className="nav-link">Todo App</span>
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/stories-app">
              <span className="nav-link">Hacker News Stories App</span>
            </Link>
          </li>
        </ul>
      </StyledNavbar>

      <div className="container-fluid">
        <Switch>
          <Route path="/todo-app">
            <TodoApp />
          </Route>
          <Route path="/stories-app">
            <HackerNewStories />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
